import DetailFile from "../taskList/detailFile";
import { getAction, postAction } from "../../../api/manage";
import { JeecgListMixin } from "../../../mixins/JeecgListMixin2";
export default {
  name: "CreateTask",
  mixins: [JeecgListMixin],
  components: {
    DetailFile: DetailFile
  },
  data: function data() {
    return {
      selectInit: '请选任务类型',
      selectInit2: '请选任务详情',
      visible: false,
      title: '新建任务',
      confirmLoading: false,
      tasks: [],
      task: [],
      tasksDetialsLists: [],
      // 任务详情
      taskDetail: {
        data: {},
        busFunction: {},
        detailList: {}
      },
      typeDetail: {},
      userName: '',
      userdept: '',
      //展示哪个页面可见
      isShow: {
        receiveFile: false
      },
      url: {
        selectTaskType: '/oaBus/newTask/findModelPermit1',
        selectTaskDetail: '/oaBus/newTask/findFunctionPermit'
      }
    };
  },
  created: function created() {
    var userdata = localStorage.getItem('userdata'); // alert(userdata.userInfo.username)

    this.userName = userdata.userInfo.username;
    console.log('++++++++++++++++++++++++', userdata.userInfo.username);
  },
  methods: {
    show: function show() {
      var _this = this;

      this.selectInit = '请选任务类型';
      this.selectInit2 = '请选任务详情'; //选择任务类型

      getAction(this.url.selectTaskType).then(function (res) {
        if (res.success) {
          _this.tasks = res.result;
        }
      });
      this.visible = true;
    },
    handleCancel: function handleCancel() {
      //清空数据
      this.$emit('close');
      this.visible = false;
    },
    selectTaskType: function selectTaskType(e) {
      console.log(e);
      this.getTaskData(e);
      this.selectInit2 = '';
    },
    getTaskData: function getTaskData(e) {
      var _this2 = this;

      //选择任务类型
      getAction(this.url.selectTaskDetail, {
        modelId: e
      }).then(function (res) {
        if (res.success) {
          _this2.tasksDetialsLists = res.result;
        }
      });
    }
  }
};
